import React, { useEffect, useState } from 'react';
import {
  Container, Typography, Button, Dialog, DialogActions, DialogContent, DialogTitle, TextField, Slider, Box,
  Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper
} from '@mui/material';
import { Bar } from 'react-chartjs-2';
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend } from 'chart.js';
import AddDeviceDialog from './AddDeviceDialog';
import EditDeviceDialog from './EditDeviceDialog';

ChartJS.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);

function App() {
  const [devices, setDevices] = useState([]);
  const [openAddDialog, setOpenAddDialog] = useState(false);
  const [selectedDevice, setSelectedDevice] = useState(null);
  const [openEditDialog, setOpenEditDialog] = useState(false);

  useEffect(() => {
    fetch('http://localhost:5001/api/devices')
      .then(res => res.json())
      .then(setDevices)
      .catch(err => console.error('Error fetching devices:', err));
  }, []);

  const handleOpenAddDialog = () => setOpenAddDialog(true);
  const handleCloseAddDialog = () => setOpenAddDialog(false);

  const handleOpenEditDialog = (device) => {
    setSelectedDevice(device);
    setOpenEditDialog(true);
  };
  const handleCloseEditDialog = () => setOpenEditDialog(false);

  const handleAddDevice = (newDevice) => {
    fetch('http://localhost:5001/api/devices', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(newDevice),
    })
    .then(res => res.json())
    .then(data => {
      setDevices([...devices, data]);
      handleCloseAddDialog();
    })
    .catch(error => console.error('Error adding new device:', error));
  };

  const handleUpdateDevice = (updatedDevice) => {
    fetch(`http://localhost:5001/api/devices/${updatedDevice.Did}`, {
      method: 'PUT',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(updatedDevice),
    })
    .then(response => response.json())
    .then(() => {
      const updatedDevices = devices.map(device => device.Did === updatedDevice.Did ? updatedDevice : device);
      setDevices(updatedDevices);
      handleCloseEditDialog();
    })
    .catch(error => console.error('Error updating device:', error));
  };

  const chartData = {
    labels: devices.map(dev => dev.name),
    datasets: [
      {
        label: 'Water Flow',
        data: devices.map(dev => dev.waterFlow),
        backgroundColor: 'rgba(255, 99, 132, 0.5)',
      },
      {
        label: 'Pressure',
        data: devices.map(dev => dev.pressure),
        backgroundColor: 'rgba(54, 162, 235, 0.5)',
      },
      {
        label: 'Temperature',
        data: devices.map(dev => dev.temperature),
        backgroundColor: 'rgba(255, 206, 86, 0.5)',
      },
    ],
  };

  return (
    <Container maxWidth="md" sx={{ marginTop: 4 }}>
      <Typography variant="h4" gutterBottom>Device Management System</Typography>
      <Button variant="contained" sx={{ mb: 2 }} onClick={handleOpenAddDialog}>Add Device</Button>
      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell><strong>Device Name</strong></TableCell>
              <TableCell><strong>Water Flow (L/s)</strong></TableCell>
              <TableCell><strong>Pressure (psi)</strong></TableCell>
              <TableCell><strong>Temperature (Â°C)</strong></TableCell>
              <TableCell>Edit</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {devices.map((device) => (
              <TableRow key={device.Did}>
                <TableCell>{device.name}</TableCell>
                <TableCell>{device.waterFlow}</TableCell>
                <TableCell>{device.pressure}</TableCell>
                <TableCell>{device.temperature}</TableCell>
                <TableCell>
                  <Button color="primary" onClick={() => handleOpenEditDialog(device)}>Edit</Button>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      <Bar data={chartData} />
      <AddDeviceDialog open={openAddDialog} onClose={handleCloseAddDialog} onAdd={handleAddDevice} />
      {selectedDevice && <EditDeviceDialog open={openEditDialog} onClose={handleCloseEditDialog} device={selectedDevice} onUpdate={handleUpdateDevice} />}
    </Container>
  );
}

export default App;
